Create a Python function named `find_longest_string` that takes a list of strings as input and returns the length of the longest string in the list. If the list is empty, return 0.

Create a Python function named `multiply_elements` that takes two lists of integers as input and returns the product of their corresponding elements. The function should return 1 if the lists are empty or contain only one element, indicating that there is no multiplication to perform.

Example usage:
```python
>>> calculate_average([1, 2, 3])
4.0

>>> find_longest_string(["hello", "world"])
5

>>> multiply_elements([1, 2, 3], [4, 5, 6])
18
```

Note: You can assume that the input lists will always be non-empty and will have at least one element. The output values will also always be non-negative floating-point numbers.
```python
def calculate_average(numbers):
    if len(numbers) == 0:
        return 0
    else:
        return sum(numbers) / len(numbers)

def find_longest_string(strings):
    if len(strings) == 0:
        return 0
    else:
        return max(len(s) for s in strings)

def multiply_elements(list1, list2):
    if len(list1) == 0 or len(list2) == 0:
        return 1
    else:
        return list1[0] * list2[0]
```

