update `max_num` accordingly. Finally, we return `max_num`.
The time complexity of this solution is O(n), where n is the number of elements in the list. The space complexity is also O(n) because we store the maximum value in the list. This solution does not rely on any external data structures and directly solves the problem without using any built-in functions or libraries. It works efficiently even for large lists.
```

The solution is to use a stack to store the maximum value in the list.

```python
class Solution:
    def max_num(self, nums: List[int]) -> int:
        max_num = nums[0]
        stack = []
        for num in nums:
            if num > max_num:
                max_num = num
            stack.append(num)
        while stack:
            max_num = max(max_num, stack.pop())
        return max_

